@valia89
Καλημέρα.Θα έλεγα να κάνεις υπομονή (όπως κάνουμε όλοι τόοσο καιρό κ όλα μια χαρά θα έλεγα;)To συγκεκριμένο άνεβηκε πριν 1 άκριβώς μέρα κ ήδη άρχισαν να διαμοιράζουν αρκετοί.

ΥΓ.Πολλοί ξεχνάτε πως οι ταχύτητες διαμοιρασμού στην Ελλάδα δεν έχουν Καμμία σχέση με αυτές του εξωτερικού...Παιδιά,ας μην κοροιδευόμαστε.Όσοι κατεβάζετε χρόνια καταλαβαίνετε τί ακριβώς εννοώ.
